import React from "react";
import { Link } from "react-router-dom";
import  { useContext } from 'react';
import ThemeContext, { ThemeProvider, themes } from "../Components/utils/global.context";

//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Navbar = () => {
    const { theme, toggleTheme } = useContext(ThemeContext);
    return (
        <nav style={{ background: theme.background, color: theme.font, padding: '10px', margin: '10px' }}>
            <ul>
                <li>
                    <Link to="/inicio">Inicio</Link>
                </li>
                <li>
                    <Link to="/contacto">Contacto</Link>
                </li>
                <li>
                    <Link to="/favoritos">Favoritos</Link>
                </li>
            </ul>
            {/* Deberan implementar ademas la logica para cambiar de Theme con el button */}
            <button onClick={toggleTheme}>{theme === themes.light ? 'claro' : 'oscuro'}</button>
        </nav>
    );
};

export default Navbar;
